protected void runCleanerTask() {
  Runnable task =
      CleanerTask.create(conf, store, metrics, cleanerTaskLock);
  // this is a non-blocking call (it simply submits the task to the executor
  // queue and returns)
  this.scheduledExecutor.execute(task);
}
